import axios from "axios";
import { useContext, useEffect, useState } from "react";
// import { AuthenticationContext } from "../../../AuthenticationProvider";
import { useForm } from "react-hook-form";

interface UserType {
  name: string;
  email: string;
  password: string;
  _id?: string;
}
const Profile = () => {
  // const valueOf = useContext(AuthenticationContext);
  // console.log(valueOf);

  const [user, setUser] = useState<UserType>({
    name: "",
    password: "",
    email: "",
  });

  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm();
  const onSubmit = (data) => {
    console.log(data);
  };

  useEffect(() => {
    axios
      .get("/auth")
      .then(({ data }) => {
        console.log(data);
        setUser(data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);
  console.log(user.name);

  return (
    <Box m={5}>
      <TextField
        variant="outlined"
        margin="normal"
        label="Name"
        type="text"
        fullWidth
        value={user.name}
      />
      <TextField
        variant="outlined"
        margin="normal"
        label="Email Address"
        type="email"
        fullWidth
        value={user.email}
      />
      <TextField
        variant="outlined"
        margin="normal"
        label="Password"
        type="text"
        fullWidth
      />

      <Button color="primary" variant="contained">
        Update
      </Button>
    </Box>
  );
};

export default Profile;
